          </Route>
          <Route path="/refused">

          </Route>
          <Route path="/error">

          </Route>
          <Route path="/">
            <CheckOut onPaymentResponse={onPaymentResponse} />
          </Route>

        </Switch>
      </Router>

    </div>
  );
}



export default App;
